  \"Non-game monitoring at Benton Lake National Wildlife Refuge and Benton Lake Wetland
  Management District: 1994-1998 point count census summary\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:47.824252\",\n\t\"name\": \"non-game-monitoring-at-benton-lake-national-wildlife-refuge-and-benton-lake-wetland-manage\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Point Count Censuses were conducted in
  the short-grass prairie at Benton Lake National Wildlife Refuge each year for five
  years between 1994-1998. Point Counts were also conducted for four years (1995-1998)
  at Purnell WP A (Waterfowl Production Area) and Kingsbury Lake WPA. Historically,
  much of the avian research effort in the prairie pothole region has been focused
  on waterfowl. The purpose of this work is to monitor non-game grassland birds and
  to incorporate relevant data when defining habitat objectives. In addition, this
  monitoring program contributes to the Montana Natural Heritage Program's Bird Distribution
  Publication.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
